import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Star, Quote, ChevronLeft, ChevronRight, TrendingUp, Phone, MapPin, CheckCircle } from 'lucide-react';

const ClientResults = () => {
  const [currentTestimonial, setCurrentTestimonial] = useState(0);

  const testimonials = [
    {
      name: 'Sarah Johnson',
      business: 'Dental Practice',
      location: 'Austin, TX',
      image: 'https://via.placeholder.com/80x80/3B82F6/FFFFFF?text=SJ',
      quote: 'Rankly360 transformed our practice. We went from 2-3 calls per week to 15-20 calls per day. Our Google Maps ranking went from page 3 to #1 in just 6 weeks!',
      stats: {
        calls: '+650%',
        ranking: '#1',
        time: '6 weeks'
      },
      rating: 5
    },
    {
      name: 'Mike Rodriguez',
      business: 'Roofing Company',
      location: 'Phoenix, AZ',
      image: 'https://via.placeholder.com/80x80/FF6B00/FFFFFF?text=MR',
      quote: 'The results have been incredible. We\'re now ranking #1 for "roofing company Phoenix" and getting qualified leads every day. ROI has been over 300%.',
      stats: {
        calls: '+420%',
        ranking: '#1',
        time: '8 weeks'
      },
      rating: 5
    },
    {
      name: 'Jennifer Chen',
      business: 'Personal Training Studio',
      location: 'Denver, CO',
      image: 'https://via.placeholder.com/80x80/10B981/FFFFFF?text=JC',
      quote: 'Rankly360 helped us dominate local search. We\'re now the top result for "personal trainer Denver" and our membership has doubled in 3 months.',
      stats: {
        calls: '+280%',
        ranking: '#1',
        time: '3 months'
      },
      rating: 5
    }
  ];

  const results = [
    {
      icon: TrendingUp,
      value: '420%',
      label: 'Average Increase in Calls',
      color: 'text-green-500'
    },
    {
      icon: MapPin,
      value: 'Top 3',
      label: 'Average Google Maps Ranking',
      color: 'text-blue-500'
    },
    {
      icon: Phone,
      value: '150+',
      label: 'Happy Clients',
      color: 'text-orange-500'
    }
  ];

  const nextTestimonial = () => {
    setCurrentTestimonial((prev) => (prev + 1) % testimonials.length);
  };

  const prevTestimonial = () => {
    setCurrentTestimonial((prev) => (prev - 1 + testimonials.length) % testimonials.length);
  };

  return (
    <section id="results" className="section-padding bg-white">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl lg:text-5xl font-bold text-gray-900 mb-6 tracking-tight">
            Client Success Stories
          </h2>
          <p className="text-xl lg:text-2xl text-gray-600 max-w-4xl mx-auto leading-relaxed font-light">
            See how we've helped local businesses dominate their markets and generate more leads.
          </p>
        </motion.div>

        {/* Results Stats */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
          className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-16"
        >
          {results.map((result, index) => (
            <motion.div
              key={result.label}
              initial={{ opacity: 0, scale: 0.8 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.6, delay: 0.4 + index * 0.1 }}
              viewport={{ once: true }}
              className="text-center"
            >
              <div className="flex justify-center mb-4">
                <div className="w-16 h-16 bg-gray-100 rounded-full flex items-center justify-center">
                  <result.icon className={`w-8 h-8 ${result.color}`} />
                </div>
              </div>
              <div className={`text-4xl font-bold ${result.color} mb-2`}>
                {result.value}
              </div>
              <div className="text-gray-600">
                {result.label}
              </div>
            </motion.div>
          ))}
        </motion.div>

        {/* Testimonials */}
        <div className="max-w-4xl mx-auto">
          <motion.div
            key={currentTestimonial}
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5 }}
            className="bg-gradient-to-br from-primary-50/80 to-orange-50/80 backdrop-blur-sm rounded-3xl p-8 md:p-12 relative shadow-2xl border border-white/30"
          >
            {/* Quote Icon */}
            <div className="absolute top-6 right-6">
              <Quote className="w-8 h-8 text-primary-300" />
            </div>

            <div className="flex flex-col md:flex-row items-start gap-8">
              {/* Client Info */}
              <div className="flex-shrink-0 text-center md:text-left">
                <div className="relative">
                  <img
                    src={testimonials[currentTestimonial].image}
                    alt={testimonials[currentTestimonial].name}
                    className="w-24 h-24 rounded-2xl mx-auto md:mx-0 mb-4 shadow-xl border-4 border-white"
                  />
                  <div className="absolute -bottom-2 -right-2 w-8 h-8 bg-gradient-to-br from-green-400 to-green-500 rounded-full flex items-center justify-center">
                    <CheckCircle className="w-4 h-4 text-white" />
                  </div>
                </div>
                <h3 className="font-bold text-gray-900 text-lg">
                  {testimonials[currentTestimonial].name}
                </h3>
                <p className="text-gray-600">
                  {testimonials[currentTestimonial].business}
                </p>
                <p className="text-gray-500 text-sm">
                  {testimonials[currentTestimonial].location}
                </p>

                {/* Rating */}
                <div className="flex justify-center md:justify-start mt-2">
                  {[...Array(testimonials[currentTestimonial].rating)].map((_, i) => (
                    <Star key={i} className="w-4 h-4 text-yellow-400 fill-current" />
                  ))}
                </div>
              </div>

              {/* Quote and Stats */}
              <div className="flex-1">
                <blockquote className="text-lg lg:text-xl text-gray-700 mb-6 leading-relaxed font-light italic">
                  "{testimonials[currentTestimonial].quote}"
                </blockquote>

                {/* Stats */}
                <div className="grid grid-cols-3 gap-4">
                  <div className="text-center">
                    <div className="text-2xl font-bold text-green-600">
                      {testimonials[currentTestimonial].stats.calls}
                    </div>
                    <div className="text-sm text-gray-600">More Calls</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-blue-600">
                      {testimonials[currentTestimonial].stats.ranking}
                    </div>
                    <div className="text-sm text-gray-600">Google Ranking</div>
                  </div>
                  <div className="text-center">
                    <div className="text-2xl font-bold text-orange-600">
                      {testimonials[currentTestimonial].stats.time}
                    </div>
                    <div className="text-sm text-gray-600">Time to Results</div>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>

          {/* Navigation */}
          <div className="flex justify-center items-center mt-8 space-x-4">
            <motion.button
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              onClick={prevTestimonial}
              className="w-12 h-12 bg-white rounded-full shadow-lg flex items-center justify-center hover:shadow-xl transition-shadow duration-200"
            >
              <ChevronLeft className="w-6 h-6 text-gray-600" />
            </motion.button>

            {/* Dots */}
            <div className="flex space-x-2">
              {testimonials.map((_, index) => (
                <button
                  key={index}
                  onClick={() => setCurrentTestimonial(index)}
                  className={`w-3 h-3 rounded-full transition-colors duration-200 ${
                    index === currentTestimonial ? 'bg-primary-500' : 'bg-gray-300'
                  }`}
                />
              ))}
            </div>

            <motion.button
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              onClick={nextTestimonial}
              className="w-12 h-12 bg-white rounded-full shadow-lg flex items-center justify-center hover:shadow-xl transition-shadow duration-200"
            >
              <ChevronRight className="w-6 h-6 text-gray-600" />
            </motion.button>
          </div>
        </div>

        {/* CTA */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mt-16"
        >
          <div className="bg-gradient-to-r from-primary-600 to-orange-500 rounded-2xl p-8 text-white">
            <h3 className="text-2xl font-bold mb-4">
              Ready to Join Our Success Stories?
            </h3>
            <p className="text-lg mb-6 opacity-90">
              Get started with a free consultation and see how we can help your business grow.
            </p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="bg-white text-primary-600 font-semibold py-3 px-8 rounded-lg hover:bg-gray-50 transition-colors duration-200"
            >
              Book Your Free Consultation
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default ClientResults;
